import React, { Component } from 'react';
import FootLeft from '../atoms/footer/FootLeft';
import FootMid from '../molecules/footer/FootMid';
import FootRight from '../molecules/footer/FootRight';
import './foot.scss';

class Foot extends Component {
    render() {
        return (
            <section class='foot'>
                <FootLeft />
                <FootMid />
                <FootRight />
            </section>
        )
    }
}

export default Foot
